    <script src="weixin/checkinfo/js/ajax.js"></script>
    <script src="weixin/common/common.js"></script>
    <script>
        $.ajax({
            url: WX_URL + 'requestAjax.php',
            type: 'POST',
            dataType: 'json',
            data: {
                'programId': '',
                'scheduleId': '',
                'identity': 'checkTicketInfo'
            },
            success: function(res) {
                //  alert(JSON.stringify(res));
                var data = JSON.parse(res.result);
                data_fixed(data);
                data_arr(data);
                // 渲染 pda  数据
                var arr_arr = data.pdaCheckData;
                var html_tr = "";
                $.each(arr_arr, function(i, k) {
                    //   alert(k.pdaId);
                    html_tr = '<tr class="groups"><td>' + k.pdaId + '</td><td>' + k.pdaName +
                        '</td><td>' + k.checkNumber + '</td></tr>'
                    $("#area_body_pda").append(html_tr);
                });
            },
            error: function() {
                alert("请求失败")
            }
        })

        $("#quyuBtn").on("click", function() {
            $(this).addClass("tab_now_on");
            $(this).siblings().removeClass("tab_now_on");
            $(".centen_quyushuju").show();
            $(".centen_pdashuju").hide();
        })
        $("#PDABtn").on("click", function() {
            $(this).addClass("tab_now_on");
            $(this).siblings().removeClass("tab_now_on");
            $(".centen_pdashuju").show();
            $(".centen_quyushuju").hide();
        });
    </script>
